import * as types from '../constants/Actiontype';                                                            

var data = JSON.parse(localStorage.getItem('todoItems'));
var initialState = data  ;

var myReducer = ( state = initialState, action) => {
    switch(action.type){
        case types.LIST_ALL:
            // state = [...];
            return state;
        default : return state;
    }

}

export default myReducer;
